import React,{Component} from 'react';
import 'bootstrap/dist/css/bootstrap.css';


class Navbar extends Component{
    render(){
        return(
            <Navbar bg="dark" variant="dark" sticky="top">
                    <Navbar.Brand>
                        Logo
                    </Navbar.Brand>
            </Navbar>
        )
    }
}

export default Navbar
